    public static void registerNetworkStateListener(Context context)
    {
        isLowPhone = isLowendPhone(context);
        IntentFilter intentfilter = new IntentFilter();
        intentfilter.addAction("android.net.conn.CONNECTIVITY_CHANGE");
        context.getApplicationContext().registerReceiver(getOrCreateReceiver(context), intentfilter);
        phoneStateListener = getOrCreatePhoneStateListener(context);
        ((TelephonyManager)context.getSystemService("phone")).listen(phoneStateListener, 64);
        notifyStateChange(context);
        firstRead = true;
    }

